               <ProgressBar currentProgress={currentProgress}  totalItems={totalItems} />
               
           </li>
  
           <br></br>
 
          <li className="nav-list-item">
            <i class="fa-solid fa-home  "></i>
                                             
 
            <span>
              <Link to="/dashboard/project" onClick={handleOverviewButtonClick}>ACFC Overview</Link>
              
            </span>
          </li>
 
          <br></br>
          <br></br>
 
          <li className="nav-list-item">
            <i class="fa-solid fa-chair"></i>
 
            <span>
              <Link to="/dashboard/domainnew" onClick={handleDomainButtonClick}>Domain Foundation</Link>
            </span>
          </li>
 
          <br></br>
          <br></br>
 
          <li className="nav-list-item">
            <i class="fa-solid fa-file-circle-plus "></i>
 
            <span>
              <Link to="/dashboard/edoprod"  onClick={handleMandatoryButtonClick}>Mandatory Trainings</Link>
            </span>
          </li>
 
